      // The most recent voted slot will be needed","                        let most_recent_voted_slot = tower.tower_slots().last().cloned();","","                        // Find the newest mostly_confirmed_bank on vote_bank's fork","                        if let Some(mostly_confirmed_bank) =","                            ReplayStage::first_mostly_confirmed_bank(vote_bank.clone(), \u0026progress)","                        {","                            // If there is a prior vote, then take all banks between the most recently voted slot and","                            // the new mostly_confirmed_bank, but not including either (the mostly_confirmed bank will","                            // be included in the extend below).","                            if let Some(most_recent_voted_slot) = most_recent_voted_slot {","                                if let Some(mostly_confirmed_bank_parent) =","                                    mostly_confirmed_bank.parent()","                                {","                                    vote_banks = ReplayStage::banks_between_and_including(","                                        most_recent_voted_slot + 1,","                                        mostly_confirmed_bank_parent.clone(),","                                    );","                                }","                            }","","                            // Also take the mostly_confirmed bank plus threshold_ahead_count banks after it, up to","                            // vote_bank.  If mostly_confirmed_bank is at or before the most recently voted slot, then","                            // slots already voted on will be included, but will be removed by the filter operation","                            // that follows this.","                            vote_banks.extend(","                                ReplayStage::banks_between_and_including(","                                    mostly_confirmed_bank.slot(),","                                    vote_bank.clone(),","                                )","                                .into_iter()","                                .take((threshold_ahead_count + 1) as usize)","                                .collect::\u003cVec\u003cArc\u003cBank\u003e\u003e\u003e(),","                            );","","                            // Filter out:","                            // 1. Already-voted-on banks","                            // 2. Any banks which can't be voted on because they are locked out","                            // 3. If there is a \"skip ahead threshold\", all votes after a skip if the first vote after","                            //    the skip doesn't meet the threshold.","                            // 4. All except the first 31 votes that aren't filtered by 1 - 3.","                            let after_skip_threshold = tower.get_after_skip_threshold();","                            let mut filtered_vote_banks = vec![];","                            let mut filtered_vote_slots = vec![];","                            for bank in \u0026vote_banks {","                                // 1","                                if bank.slot() \u003c= most_recent_voted_slot.unwrap_or(0) {","                                    continue;","                                }","                                // 2","                                if tower.is_locked_out_including(","                                    bank.slot(),","                                    ancestors.get(\u0026bank.slot()).unwrap(),","                                    \u0026filtered_vote_slots,","                                ) {","                                    info!(","                                        \"vote-optimizer cannot vote on {} because it's locked out\",","                                        bank.slot()","                                    );","                                    continue;","                                }","                                // 3","                                if bank.slot()","                                    \u003e (bank.parent().map(|parent| parent.slot()).unwrap_or(0) + 1)","                                {","                                    match after_skip_threshold {","                                        Some(1) =\u003e {","                                            if !progress","                                                .get_fork_stats(bank.slot())","                                                .unwrap()","                                                .is_mostly_confirmed","                                            {","                                                info!(","                                                    \"vote-optimizer after skip refusing {}\",","                                                    bank.slot()","                                                );","                                                break;","                                            }","                                        }","                                        Some(2) =\u003e {","                                            if !progress","                                                .get_fork_stats(bank.slot())","                                                .unwrap()","                                                .is_supermajority_confirmed","                                            {","                                                info!(","                                                    \"vote-optimizer after skip refusing {}\",","                                                    bank.slot()","                                                );","                                                break;","                                            }","                                        }","                                        _ =\u003e (),","                                    }","                                }","                                filtered_vote_banks.push(bank.clone());","                                // 4","                                if filtered_vote_banks.len() == 31 {","                                    break;","                                }","                                filtered_vote_slots.push(bank.slot());","                            }","","                            // Now filter out any banks which would increase lockout past the most recently","                            // confirmed slot on this fork to \u003e 64.  Remove the newest first so that they can","                            // be voted on later if they end up being votable.","                            if !filtered_vote_banks.is_empty() {","                                let first_slot_to_not_lock_out =","                                    ReplayStage::last_confirmed_slot(vote_bank, \u0026progress) + 65;","                                tower.pop_votes_locked_out_at(","                                    \u0026mut filtered_vote_slots,","                                    first_slot_to_not_lock_out,","                                );","                                if filtered_vote_banks.len() \u003e filtered_vote_slots.len() {","                                    info!(","                                        \"vote-optimizer cannot vote on {} or subsequent slots because lockout would \\","                                         exceed slot {}\",","                                        filtered_vote_banks[filtered_vote_slots.len()].slot(),","                                        first_slot_to_not_lock_out - 1);","                                    filtered_vote_banks.truncate(filtered_vote_slots.len());","                                }","                            }","","                            vote_banks = filtered_vote_banks;","","                            // If there are no banks included, then check to see if there are more than","                            // threshold_escape_count banks since the last voted bank that have not been voted on yet.","                            // If there are, vote for the oldest not voted on bank, so as not to get too far behind","                            // the cluster and miss voting opportunities.","                            if vote_banks.is_empty() {","                                if let Some(threshold_escape_count) =","                                    tower.get_threshold_escape_count()","                                {","                                    if let Some(most_recent_voted_slot) = most_recent_voted_slot {","                                        // Get all banks that could be voted on, which doesn't include banks that","                                        // can't be voted on because they would be locked out","                                        let mut unvoted_banks = vec![];","                                        let mut unvoted_slots = vec![];","                                        for bank in ReplayStage::banks_between_and_including(","                                            most_recent_voted_slot + 1,","                                            vote_bank.clone(),","                                        ) {","                                            if !tower.is_locked_out_including(","                                                bank.slot(),","                                                ancestors.get(\u0026bank.slot()).unwrap(),","                                                \u0026unvoted_slots,","                                            ) {","                                                unvoted_banks.push(bank.clone());","                                                unvoted_slots.push(bank.slot());","                                            }","                                        }","","                                        if unvoted_banks.len() \u003e (threshold_escape_count as usize) {","                                            info!(","                                                \"vote-optimizer voting on escape slot {}\",","                                                unvoted_banks[0].slot()","                                            );","                                            vote_banks.push(unvoted_banks[0].clone());","                                        }","                                    } else {","                                        // Else have never voted; in this case, just vote on the proposed bank","                                        info!(","                                            \"vote-optimizer never voted, so voting on {}\",","                                            vote_bank.slot()","                                        );","                                        vote_banks.push(vote_bank.clone());","                                    }","                                }","                            }","","                            // Now expire votes from the tower's vote_state if they are on a different fork than the","                            // votes.  Expiring only these votes is only allowed with VoteStateUpdate, which no longer","                            // requires expiration of on-fork votes.","                            if let Some(last_new_vote) = vote_banks.last() {","                                let ancestors = ancestors.get(\u0026last_new_vote.slot()).unwrap();","                                while let Some(vote) = tower.vote_state.last_lockout() {","                                    // If the vote is not an ancestor of the bank, then we must have just","                                    // switched forks away from it, so remove it from the tower","                                    if !ancestors.contains(\u0026vote.slot()) {","                                        info!(\"vote-optimizer purged {}\", vote.slot());","                                        tower.vote_state.votes.pop_back();","                                    } else {","                                        break;","                                    }","                                }","                            }","                            // Arrange for process_next_vote_slot() to be called with a flag telling it not to do","                            // any popping since if there was any popping to be done, we already did it.","                            pop_expired = false;","                        }","                    } else {","                        // Not threshold voting, so just vote on the proposed bank","                        vote_banks.push(vote_bank.clone());","                    }","","                    if !vote_banks.is_empty() {","                        Self::handle_votable_banks(","                            \u0026vote_banks,","                            switch_fork_decision,","                            \u0026bank_forks,","                            \u0026mut tower,","                            \u0026mut progress,","                            \u0026vote_account,","                            \u0026identity_keypair,","                            \u0026authorized_voter_keypairs.read().unwrap(),","                            \u0026blockstore,","                            \u0026leader_schedule_cache,","                            \u0026lockouts_sender,","                            \u0026accounts_background_request_sender,","                            \u0026latest_root_senders,","                            \u0026rpc_subscriptions,","                            \u0026block_commitment_cache,","                            \u0026mut heaviest_subtree_fork_choice,","                            \u0026bank_notification_sender,","                            \u0026mut duplicate_slots_tracker,","                            \u0026mut duplicate_confirmed_slots,","                            \u0026mut unfrozen_gossip_verified_vote_hashes,","                            \u0026mut voted_signatures,","                            \u0026mut has_new_vote_been_rooted,","                            \u0026mut replay_timing,","                            \u0026voting_sender,","                            \u0026mut epoch_slots_frozen_slots,","                            \u0026drop_bank_sender,","                            wait_to_vote_slot,","                            pop_expired,","                        );","                    }","                }","                voting_time.stop();","","                let mut reset_bank_time = Measure::start(\"reset_bank\");","                // Reset onto a fork","                if let Some(reset_bank) = reset_bank {","                    if last_reset != reset_bank.last_blockhash() {","                        info!(","                            \"vote bank: {:?} reset bank: {:?}\",","                            vote_bank","                                .as_ref()","                                .map(|(b, switch_fork_decision)| (b.slot(), switch_fork_decision)),","                            reset_bank.slot(),","                        );","                        let fork_progress = progress","                            .get(\u0026reset_bank.slot())","                            .expect(\"bank to reset to must exist in progress map\");","                        datapoint_info!(","                            \"blocks_produced\",","                            (\"num_blocks_on_fork\", fork_progress.num_blocks_on_fork, i64),","                            (","                                \"num_dropped_blocks_on_fork\",","                                fork_progress.num_dropped_blocks_on_fork,","                                i64","                            ),","                        );","","                        if my_pubkey != cluster_info.id() {","                            identity_keypair = cluster_info.keypair().clone();","                            let my_old_pubkey = my_pubkey;","                            my_pubkey = identity_keypair.pubkey();","","                            // Load the new identity's tower","                            tower = Self::load_tower(","                                tower_storage.as_ref(),","                                \u0026my_pubkey,","                                \u0026vote_account,","                                \u0026bank_forks,","                            );","                            // Ensure the validator can land votes with the new identity before","                            // becoming leader","                            has_new_vote_been_rooted = !wait_for_vote_to_start_leader;","                            warn!(\"Identity changed from {} to {}\", my_old_pubkey, my_pubkey);","                        }","","                        Self::reset_poh_recorder(","                            \u0026my_pubkey,","                            \u0026blockstore,","                            reset_bank.clone(),","                            \u0026poh_recorder,","                            \u0026leader_schedule_cache,","                        );","                        last_reset = reset_bank.last_blockhash();","                        tpu_has_bank = false;","","                        if let Some(last_voted_slot) = tower.last_voted_slot() {","                            // If the current heaviest bank is not a descendant of the last voted slot,","                            // there must be a partition","                            partition_info.update(","                                Self::is_partition_detected(","                                    \u0026ancestors,","                                    last_voted_slot,","                                    heaviest_bank.slot(),","                                ),","                                heaviest_bank.slot(),","   